data Torrent
    = Torrent
    { tAnnounce     :: ByteString
    , tAnnounceList :: [ByteString]
    , tComment      :: ByteString
    , tCreatedBy    :: Maybe ByteString
    , tInfo         :: TorrentInfo
    , tInfoHash     :: ByteString
    } deriving (Show, Read, Typeable, Data)

data TorrentInfo
    = SingleFile
    { tLength      :: Int
    , tName        :: ByteString
    , tPieceLength :: Int
    , tPieces      :: ByteString }
    | MultiFile
    { tFiles       :: [TorrentFile]
    , tName        :: ByteString
    , tPieceLength :: Int
    , tPieces      :: ByteString
    } deriving (Show, Read, Typeable, Data)

data TorrentFile
    = TorrentFile
    { fileLength :: Int
    , filePath   :: [ByteString]
    } deriving (Show, Read, Typeable, Data)

instance Binary Torrent where
    put = put . serializeTorrent
    get = do e <- get
             case readTorrent e of
               Left err -> fail $ "Failed to parse torrent: " ++ err
               Right t  -> return t


torrentSize :: Torrent -> Int
torrentSize torrent
    = case tInfo torrent of
        s@SingleFile{} -> tLength s
        MultiFile{tFiles=files} -> P.sum (P.map fileLength files)

